import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import React from 'react';

function MainContent({ onNavigate }) {
    const onStartClick = () => {
      onNavigate('Interface1'); // Navigation vers Interface1 sur clic du bouton
    };

    return (
        <div className="container text-center">
            <h1>
                <span className="text-primary">Combien</span> de débit INTERNET ai-je besoin?
            </h1>
            <p className="mb-4">Dites-nous comment vous utilisez Internet et nous vous recommandons une vitesse Internet appropriée.</p>
            <div className="row">
                <div className="col-md-6">
                    <h2>Résidentiel</h2>
                    <button className="btn btn-primary" onClick={onStartClick}>Commencer</button>
                </div>
                <div className="col-md-6">
                    <h2>Entreprise</h2>
                    <button className="btn btn-secondary">Commencer</button>
                </div>
            </div>
        </div>
    );
}

export default MainContent;
